import React from 'react';
import {HashRouter, Router, Route, Routes} from "react-router-dom";
import App from "./App";
import Search from "./Search"

const Routers=()=>{
    return( 
        <HashRouter>
            <Routes>
                <Route path="/search" component={<Search/>}/>
                <Route exact path="/" component={<App/>}/>
            </Routes>
        </HashRouter>
    );
}

export default Routers;
